import React from 'react';


function Map() {
    return (
        <div>
            <iframe src="https://www.google.com/maps/search/%D0%B3%D1%83%D0%B3%D0%BB+%D0%BC%D0%B0%D0%BF%D1%81+%D0%9A%D0%B8%D1%97%D0%B2,+%D0%B2%D1%83%D0%BB.+%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B8+%D0%9B%D0%B0%D0%B2%D1%80%D1%83%D1%85%D1%96%D0%BD%D0%B0,+4,+%D0%A2%D0%A0%D0%A6+%22%D0%A0%D0%B0%D0%B9%D0%BE%D0%BD%22+STAFF/@50.5165176,30.5998209,17z/data=!3m1!4b1" width="600" height="700" style={{ border: 0 }} allowFullScreen="" loading="lazy"></iframe>
        </div>
    );
}

export default Map;
